import React from 'react';

export default class SignupForm extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            step: 1,
            estatetype: '',
            fullname: '',
            phone: '',
            email: '',
            region: '',
            district: '',
        }
    }
    
    prevStep = () => {
        const { step } = this.state;
        this.setState({ step: step - 1 });
    }

    
    
    render(){
        return(
